import React, { useEffect } from "react";
import { useAppDispatch, useAppSelector } from "../../../../redux/hooks";
import { fetchProductsListAsync } from "./productSlice";
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import Avatar from '@mui/material/Avatar';

const ProductsList: React.FC<{ }> = () => {
  
  const dispatch = useAppDispatch();

  async function getProductsList() {
    dispatch(fetchProductsListAsync());
  }

  const { products, loading } = useAppSelector(
    (state) => state.product
  );

  useEffect(() => {
    getProductsList()
  },[])

  return (
    <List 
      sx={{
        width: '100%',
        maxWidth: 400,
        bgcolor: 'background.paper',
        position: 'relative',
        overflow: 'auto',
        maxHeight: '40rem'
      }}
    >
      {
        loading ? (
          <div className="my-5 flex flex-col justify-start px-3">
            <label className="font-weight-light text-gray-regular">
              loading
            </label>
          </div>
        ) : products && products.length > 0 ? (
            <>
              {[...products].map((user: any, index: number) => (
                <ListItem>
                  <ListItemAvatar>
                    <Avatar>
                    </Avatar>
                  </ListItemAvatar>
                  <ListItemText primary={user.title} secondary={user.description} />
                </ListItem>
              ))}
            </>
          ) 
         : (
          <div className="my-5 flex flex-col justify-start px-3">
            <label className="font-weight-light text-gray-regular">
              No Data
            </label>
          </div>
        )
      }
    </List>
  );
};

export default ProductsList;
